
$(window).on("load",function(){$.map($(document).find(".homeslider"),function(a){var b=SwiperSlider.construct($(a).children(".swiper-container"),{autoHeight:true,navigation:{nextEl:$(a).find(".swiper-button-next"),prevEl:$(a).find(".swiper-button-prev"),},pagination:{el:$(a).find(".swiper-pagination"),clickable:true}})})});